export default {
  props: {
    id: ""
  },

  data() {
    return {
      form: {
        name: "",
        grade: "",
        description: "",
        remark: ""
      },
      rules: {
        name: [{ required: true, trigger: "blur", message: "不能为空" }]
      }
    };
  },

  mounted() {
    
  },

  methods: {
    ADD() {
      this.$confirm("是否确认新增内容", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      })
        .then(() => {
          if (!this.form.name) {
            this.$message({
              type: "error",
              message: "必填项未输入，新增用户失败"
            });
            return;
          }else{
            this.axios.post('/guanqu/web/sys-roles/',{name:this.form.name,grade:this.form.grade,description:this.form.description,remark:this.form.remark}).then((res) => {
              this.$message({
                type: "success",
                message: "新增用户成功!"
              });
              this.$emit("closewindows");
            });
          }
        })
        .catch(() => {
          // this.$message({
          //   type: "error",
          //   message: "网络错误！新增用户失败！"
          // });
        });
    },
    del(){
        this.$emit("closewindows");
    },
  },

  computed: {},

  watch: {}
};
